import Header from "../components/header";
import { useEffect } from "react";
import axiosInstance from "../auth/axios";
import { useState } from "react";

const JobsPosted = () => {

    const [jobPosts, setJobPosts] = useState([]);
    const [error, setError] = useState("");

    useEffect(
        () =>{
            axiosInstance.get("http://localhost:8000/api/v1/user-job-posts/"
            ).then((res) => {setJobPosts(res.data)
            console.log(jobPosts)})
            .catch((e) => {
                if (e){
                    setError(e.message);
                }
            })

        },[]
    )

    return(
        <>
        <Header />
        {jobPosts && (
            <div >
                <h1 style={{marginBottom: "20px" }}>Jobs you posted </h1>
            <ul style={{ padding: "20px"}}>
            {jobPosts.map((job) => {

                        return(
                            <li key={job.id}>
                            <h3>job title: {job.job_title}</h3>
                            <h3>job description</h3>
                            <p>{job.short_job_description}</p>
                            <p>{job.full_job_description}</p>
                            <hr></hr>             
                        </li>

                        )


                    }) }

            </ul>

        </div>
        )

        }
<p>{error}</p>


        </>

    )
}

export default JobsPosted;
